  "title": {
    "nb": "Folketeljinga 1910"
  },
  "description": {
    "nb": "1910-teljinga som opne dataArkivverket skal, som andre statlege organ, leggja ut data slik at andre kan ta dei i bruk på nye måtar og i kombinasjon med datasett frå andre organ. Folketeljinga 1910 er no lagt til rette for det. Ho har vore tilgjengeleg for DIFI si nasjonale tevling Apps4Norge.no i 2013 og Kulturrådet sin hackathon #hack4no i 2014. Vi ser fram mot spanande tenester basert på opne, offentlege data. Teljinga frå 1910 bør vera ei interessant kjelde å arbeida med.Arkivverket tilbyr og data frå 1910-teljinga til prosjektet Kultur – og naturreise som er eit samarbeid mellom Kulturrådet, Riksantikvaren, Direktoratet for naturforvaltning, Statens kartverk og Riksarkivet. 330.535 buplassar i Noreg i 1910 Det budde 2.391.782 menneske i Noreg i 1910. Teljinga viser at det var 279.635 bustader på landet og 50.900 bustader i byane. På landet var buplassane knytte til gards - og bruksnummer. Det var og mange husmannsplassar i 1910. I byane var buplassane knytte til gateadresser. Frå datasettet kan du søkja fram og visa på kart kvar dei fleste av desse 330.535 buplassane låg og sjå kven som budde der.Kartfesta alle buplassarGjennom eit samarbeid med Norsk kulturråd og prosjektet Kultur- og naturreise har Riksarkivaren sett i gang eit arbeid med å kartfesta alle dei 330.535 buplassane i 1910. Dette vert ein viktig del av datagrunnlaget som etaten vil tilby. Per januar 2014 har vi fått på plass koordinatar for om lag 80 % av desse bustadane gjennom å køyra saman dagens matrikkel (register over gardar, bruk og gatedresser) med opplysningane i teljinga. Det som vi ikkje har fått med på denne måten, må ein ta på andre og meir manuelle måtar. Her vil det og liggja til rette for aktiv innsats frå lokalkjende kring i landet. Teljinga i 1910 er den første kjelda som vi kartfestar. Arkivverket har svært mykje data som kan egna seg til å presentera på kart."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003e1910-teljinga som opne data\u003c/p\u003e\u003cp\u003eArkivverket skal, som andre statlege organ, leggja ut data slik at andre kan ta dei i bruk på nye måtar og i kombinasjon med datasett frå andre organ. Folketeljinga 1910 er no lagt til rette for det. Ho har vore tilgjengeleg for DIFI si nasjonale tevling Apps4Norge.no i 2013 og Kulturrådet sin hackathon #hack4no i 2014. Vi ser fram mot spanande tenester basert på opne, offentlege data. Teljinga frå 1910 bør vera ei interessant kjelde å arbeida med.\u003c/p\u003e\u003cp\u003eArkivverket tilbyr og data frå 1910-teljinga til \u003ca href\u003d\"https://kulturognaturreise.wordpress.com/\" rel\u003d\"nofollow\"\u003eprosjektet Kultur – og naturreise\u003c/a\u003e som er eit samarbeid mellom Kulturrådet, Riksantikvaren, Direktoratet for naturforvaltning, Statens kartverk og Riksarkivet. \u003c/p\u003e\u003cp\u003e\u003cstrong\u003e330.535 buplassar i Noreg i 1910 \u003c/strong\u003e\u003c/p\u003e\u003cp\u003eDet budde 2.391.782 menneske i Noreg i 1910. Teljinga viser at det var 279.635 bustader på landet og 50.900 bustader i byane. På landet var buplassane knytte til gards - og bruksnummer. Det var og mange husmannsplassar i 1910. I byane var buplassane knytte til gateadresser. Frå datasettet kan du søkja fram og visa på kart kvar dei fleste av desse 330.535 buplassane låg og sjå kven som budde der.\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eKartfesta alle buplassar\u003c/strong\u003e\u003c/p\u003e\u003cp\u003eGjennom eit samarbeid med Norsk kulturråd og prosjektet Kultur- og naturreise har Riksarkivaren sett i gang eit arbeid med å kartfesta alle dei 330.535 buplassane i 1910. Dette vert ein viktig del av datagrunnlaget som etaten vil tilby. Per januar 2014 har vi fått på plass koordinatar for om lag 80 % av desse bustadane gjennom å køyra saman dagens matrikkel (register over gardar, bruk og gatedresser) med opplysningane i teljinga. Det som vi ikkje har fått med på denne måten, må ein ta på andre og meir manuelle måtar. Her vil det og liggja til rette for aktiv innsats frå lokalkjende kring i landet. Teljinga i 1910 er den første kjelda som vi kartfestar. Arkivverket har svært mykje data som kan egna seg til å presentera på kart.\u003c/p\u003e"
