  },
  "description": {
    "nb": "Nettstedet Miljøstatus (https://miljostatus.miljodirektoratet.no) informerer om miljøets tilstand og utvikling i Norge. Nettstedet er et samarbeid mellom flere statlige etater. Miljødirektoratet er ansvarlig redaktør. De ulike etatene har faglig ansvar på de forskjellige miljøområdene.Miljøstatus viser også Norges 23 mål for miljøet (https://miljostatus.miljodirektoratet.no/miljomal/), fordelt på områdene naturmangfold, kulturminner og kulturmiljø, friluftsliv, forurensning, klima, og polarområdene.Her finner du også 200 kart om ulike miljøtema (https://miljoatlas.miljodirektoratet.no/MAKartWeb/KlientFull.htm) Tjenesten Miljødata, der du finner alle datasett og grafer sortert på miljøtema, kommer i ny versjon i løpet av 2019."
  },
