  "title": {
    "nb": "Utlysningstekster ledige stillinger - historikk"
  },
  "description": {
    "nb": "Stillingsutlysningstekster for ledige stilinger :registrert av arbeidsgiver på nav.nooffentliggjort i media (stillingsportaler, websider, aviser, tidsskrifter, o.l.) og registrert av NAVmeldt til NAV fra Eures nettverk for ledige stillinger i EuropaNAV publiserer to årlige datasett om ledige stillinger. Et med stillingsutlysningstekster og et ledige stillinger meldt til NAV med strukturerte kjennetegn ved stilling. Disse kan kobles sammen ved felles stillingsnummer. Stillingsdata meldes og registreres i NAV basert på https://lovdata.no/lov/2004-12-10-76/§7. Stillingsutlysninger som er meldt til NAV-kontorene som oppdrag er utelatt.Stillingstekstene inneholder i hovedsak den formattering som de har vært publisert i. Mange tekster inneholder derfor HTML-markører og redigeringstegn. Data er vasket slik at mesteparten av telefonnummer, epostadresser, navn, store tall (over 6 siffer), anførselstegn og kontrolltegn er fjernet og erstattet med symbolet #. Strukturerte kjennetegen for stillinger som er vasket bort kan hentes fra datasettet ledige stillinger meldt til NAV. Den tekniske løsningen som henter ut stillingstekster henter kun ut de 4000 første tegn av stillingstekstene. NAV har i 2017 i samarbeid med andre aktører i stillingsmarkedet fått økt antall stillinger i NAVs stilingsdatabase. Økningen har også ført til en større andel stillinger med over 4000 tegn, og som dessverre blir avkortet i dette datasettet. Mer informasjon:* Om statistikken ledige stillinger på nav.no* RSS og annen online tilgang til ledige stillinger på nav.no"
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003e\u003cstrong\u003eStillingsutlysningstekster for ledige stilinger \u003c/strong\u003e:\u003c/p\u003e\u003col\u003e\u003cli\u003e\u003cp\u003eregistrert av arbeidsgiver på nav.no\u003c/p\u003e\u003c/li\u003e\u003cli\u003e\u003cp\u003eoffentliggjort i media (stillingsportaler, websider, aviser, tidsskrifter, o.l.) og registrert av NAV\u003c/p\u003e\u003c/li\u003e\u003cli\u003e\u003cp\u003emeldt til NAV fra Eures nettverk for ledige stillinger i Europa\u003c/p\u003e\u003c/li\u003e\u003c/ol\u003e\u003cp\u003eNAV publiserer to årlige datasett om ledige stillinger. Et med \u003cstrong\u003estillingsutlysningstekster \u003c/strong\u003eog et \u003cstrong\u003e\u003ca href\u003d\"http://data.norge.no/data/arbeids-og-velferdsetaten-nav/ledige-stillinger-meldt-til-nav-historikk\" rel\u003d\"nofollow\"\u003eledige stillinger meldt til NAV\u003c/a\u003e\u003c/strong\u003e med strukturerte kjennetegn ved stilling. Disse kan kobles sammen ved felles stillingsnummer. Stillingsdata meldes og registreres i NAV basert på \u003ca href\u003d\"https://lovdata.no/lov/2004-12-10-76/§7\" rel\u003d\"nofollow\"\u003ehttps://lovdata.no/lov/2004-12-10-76/§7\u003c/a\u003e. Stillingsutlysninger som er meldt til NAV-kontorene som oppdrag er utelatt.\u003c/p\u003e\u003cp\u003eStillingstekstene inneholder i hovedsak den formattering som de har vært publisert i. Mange tekster inneholder derfor HTML-markører og redigeringstegn. Data er vasket slik at mesteparten av telefonnummer, epostadresser, navn, store tall (over 6 siffer), anførselstegn og kontrolltegn er fjernet og erstattet med symbolet #. Strukturerte kjennetegen for stillinger som er vasket bort kan hentes fra datasettet ledige stillinger meldt til NAV. Den tekniske løsningen som henter ut stillingstekster henter kun ut de 4000 første tegn av stillingstekstene. \u003c/p\u003e\u003cp\u003eNAV har i 2017 i samarbeid med andre aktører i stillingsmarkedet fått økt antall stillinger i NAVs stilingsdatabase. Økningen har også ført til en større andel stillinger med over 4000 tegn, og som dessverre blir avkortet i dette datasettet. \u003c/p\u003e\u003cp\u003eMer informasjon:\u003c/p\u003e\u003cp\u003e* \u003ca href\u003d\"https://www.nav.no/1073745796/om-statistikken-ledige-stillinger?kap\u003d1\" rel\u003d\"nofollow\"\u003eOm statistikken ledige stillinger\u003c/a\u003e på nav.no\u003c/p\u003e\u003cp\u003e* \u003ca href\u003d\"https://tjenester.nav.no/stillinger/\" rel\u003d\"nofollow\"\u003eRSS og annen online \u003c/a\u003etilgang til ledige stillinger på nav.no\u003c/p\u003e"
