  "description": {
    "nb": "Reisetidspublikasjonen inneholder reisetider i sekunder mellom to definerte målepunkter. Reisetidene for alle delstrekningene oppdateres hvert 5 minutt. Publikasjonen inneholder reisetider for hovedveinettet rundt Oslo, Bergen, Stavanger, Kristiansand og Trondheim i tillegg E18 fra Oslo til Aust-Agder og E6 fra Ås til Kolomoen.\r\n\r\nMan må bestille tilgang til statens vegvesen sin DATEX node før man kan kople seg på publikasjonen. ",
    "en": "The travel time publication contains information about travel times between to defined measure points. The publication is updated every 5 seconds and covers the main roads around Oslo, Bergen. Trondheim, Stavanger and Kristiansand together with E18 from Oslo to Aust-Agder and E6 from Ås to Kolomoen.\r\n\r\nYou have to request a user account before you connect to the publication."
