  "title": {
    "nb": "Trafikkdata",
    "en": "Traffic data"
  },
  "description": {
    "nb": "Trafikkdata er data om trafikk på vegnettet. Trafikkdata.no har data fra det statlige og fylkeskommunale vegnettet samt noen kommunale veger.\r\nStatens vegvesen har som mål å kunne levere trafikkdata med kjent kvalitet og riktig detaljeringsgrad, samt at disse dataene er etterspurt og samlet fra riktig vegnett.\r\n\r\nDet registreres både sykler og motorkjøretøy. I sykkelpunktene blir hver enkelt sykkel registrert med fart og retning. For motorkjøretøy blir fart, lengde, kjøretøyklasse og avstand mellom kjøretøyene registrert i hvert kjørefelt.\r\n\r\nFørste registreringsutstyr i ny løsning ble satt i drift for motorkjøretøy i november 2014 og for sykkel i juli 2015. Deretter ble nye trafikkregistreringspunkter satt i drift jevnlig fram til i dag, og ytterligere noen trafikkregistreringspunkter vil settes i drift framover.",
    "en": "Data about traffic on the road network, including both national and regional roads, as well as some county roads.\r\n\r\nThe dataset includes information about cars, motorbikes, and bicycles. For motorised vehicles, we register speed, length, type of vehicle, and distance between vehicles, in each lane."
  },
