  "title": {
    "nb": "Forslag budsjett og økonomiplan 2017-2020 for Bergen kommune"
  },
  "description": {
    "nb": "Bergen kommune gir ut byrådets forslag til budsjett og økonomiplan som åpne data, der du kan gjøre dine egne sammenstillinger av innholdet i drifts- og investeringsbudsjettet.Når du leser byrådets budsjettforslag, ser du raskt at det er fullt av tall og tabeller. Med åpne data kan du lage egne fremstillinger av datagrunnlaget i budsjettet.Excel og åpent formatBergen kommune legger ut datagrunnlaget for handlings- og økonomiplanen for 2017-2020 som åpne data. Dataene blir lagt ut i maskinlesbart format som Excel-filer og semikolonseparerte CSV-filer. CSV er et format som kan deles på tvers av ulike teknologiske plattformer.Dataene som ligger i filene er ikke mer detaljerte enn dem du finner i budsjettdokumentene som er trykket eller lagt ut på kommunens nettsider.Tjenesteområde 23 - \"Under streken\" - sentrale budsjettposter, genererer netto det totalbeløp som kan fordeles til bykassens tjenesteproduksjon, definert ved de øvrige tjenesteområdene 01-21. For få å sammenlignbare tall med enkelte av tabellene i budsjettdokumentet, må tjenesteområde 23 derfor holdes utenfor de tilfellene hvor en viser bykassens tjenesteproduksjon.Kostrafunksjoner kan utledes av de 3 første sifrene i våre 5-sifrede tjenestenumre. Mer om Kostra-funksjoner finner du hos www.ssb.no/kostra Endringer underveisBudsjettet er et levende dokument. Det vil si at det fra byrådet legger frem sin første innstilling til budsjettet endelig vedtas blir gjort endringer. Detaljeringen og den konkrete fordelingen av budsjettet på tjenestesteder, som sykehjem og skoler, blir først klart i mars.Bergen kommune ønsker at informasjon om kommunens budsjett skal være lettest mulig tilgjengelig og så åpen som mulig for innbyggere og andre interesserte. Dette er viktig av hensyn til demokratiet og at kommunen forvalter store ressurser på vegne av fellesskapet."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eBergen kommune gir ut byrådets forslag til budsjett og økonomiplan som åpne data, der du kan gjøre dine egne sammenstillinger av innholdet i drifts- og investeringsbudsjettet.\u003c/p\u003e\u003cp\u003eNår du leser byrådets budsjettforslag, ser du raskt at det er fullt av tall og tabeller. Med åpne data kan du lage egne fremstillinger av datagrunnlaget i budsjettet.\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eExcel og åpent format\u003c/strong\u003e\u003c/p\u003e\u003cp\u003eBergen kommune legger ut datagrunnlaget for handlings- og økonomiplanen for 2017-2020 som åpne data. Dataene blir lagt ut i maskinlesbart format som Excel-filer og semikolonseparerte CSV-filer. CSV er et format som kan deles på tvers av ulike teknologiske plattformer.\u003c/p\u003e\u003cp\u003eDataene som ligger i filene er ikke mer detaljerte enn dem du finner i budsjettdokumentene som er trykket eller lagt ut på kommunens nettsider.\u003c/p\u003e\u003cp\u003eTjenesteområde 23 - \"Under streken\" - sentrale budsjettposter, genererer netto det totalbeløp som kan fordeles til bykassens tjenesteproduksjon, definert ved de øvrige tjenesteområdene 01-21. For få å sammenlignbare tall med enkelte av tabellene i budsjettdokumentet, må tjenesteområde 23 derfor holdes utenfor de tilfellene hvor en viser bykassens tjenesteproduksjon.\u003c/p\u003e\u003cp\u003eKostrafunksjoner kan utledes av de 3 første sifrene i våre 5-sifrede tjenestenumre. Mer om Kostra-funksjoner finner du hos \u003ca href\u003d\"https://www.ssb.no/offentlig-sektor/kostra/\" rel\u003d\"nofollow\"\u003ewww.ssb.no/kostra \u003c/a\u003e\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eEndringer underveis\u003c/strong\u003e\u003c/p\u003e\u003cp\u003eBudsjettet er et levende dokument. Det vil si at det fra byrådet legger frem sin første innstilling til budsjettet endelig vedtas blir gjort endringer. Detaljeringen og den konkrete fordelingen av budsjettet på tjenestesteder, som sykehjem og skoler, blir først klart i mars.\u003c/p\u003e\u003cp\u003eBergen kommune ønsker at informasjon om kommunens budsjett skal være lettest mulig tilgjengelig og så åpen som mulig for innbyggere og andre interesserte. Dette er viktig av hensyn til demokratiet og at kommunen forvalter store ressurser på vegne av fellesskapet.\u003c/p\u003e"
