  "title": {
    "nb": "Produksjons- og avløsertilskudd til jordbruksforetak – søknadsomgang 2019"
  },
  "description": {
    "nb": "Datasett som inneholder opplysninger fra søknad om og utbetaling av produksjonstilskudd til jordbruksforetak i søknadsomgangen 2019. Opplysningene ble hentet ut i slutten av februar 2020, og datasettet inneholder både søknader som har blitt utbetalt, og søknader som på det tidspunktet var under behandling. For søknadene som vises med utbetaling, er det de godkjente verdiene for de enkelte koder som vises, for øvrige søknader er det omsøkte verdier. Dette datasettet har erstattet datasettet som ble hentet ut i oktober 2019.For hvert foretak vises organisasjonsnummer, navn, kommunenummer og antall dyr og dekar som er oppført i den enkelte kode i søknadsskjemaet. I tillegg vises beregnet tilskudd per ordning, bunnfradrag, samt sum beregnet tilskudd etter bunnfradrag. Eventuelle andre trekk enn bunnfradrag vises ikke.Søknadsomgangen i 2019 består av to deler:Del 1 – mars:Inneholder søknadsopplysninger om antall dyr på telledato 1. mars.Del 2 – oktober:Inneholder søknadsopplysninger om antall dyr på telledato 1. oktober (inkludert bevaringsverdige husdyrraser), dyr på beite, grønt- og potetproduksjon samt disponerte arealer og hvilke vekster som dyrkes på arealene."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eDatasett som inneholder opplysninger fra søknad om og utbetaling av produksjonstilskudd til jordbruksforetak i søknadsomgangen 2019. Opplysningene ble hentet ut i slutten av februar 2020, og datasettet inneholder både søknader som har blitt utbetalt, og søknader som på det tidspunktet var under behandling. For søknadene som vises med utbetaling, er det de godkjente verdiene for de enkelte koder som vises, for øvrige søknader er det omsøkte verdier. Dette datasettet har erstattet datasettet som ble hentet ut i oktober 2019.\u003c/p\u003e\u003cp\u003eFor hvert foretak vises organisasjonsnummer, navn, kommunenummer og antall dyr og dekar som er oppført i den enkelte kode i søknadsskjemaet. I tillegg vises beregnet tilskudd per ordning, bunnfradrag, samt sum beregnet tilskudd etter bunnfradrag. Eventuelle andre trekk enn bunnfradrag vises ikke.\u003c/p\u003e\u003cp\u003eSøknadsomgangen i 2019 består av to deler:\u003c/p\u003e\u003cul\u003e\u003cli\u003eDel 1 – mars:\u003cul\u003e\u003cli\u003eInneholder søknadsopplysninger om antall dyr på telledato 1. mars.\u003c/li\u003e\u003c/ul\u003e\u003c/li\u003e\u003cli\u003eDel 2 – oktober:\u003cul\u003e\u003cli\u003eInneholder søknadsopplysninger om antall dyr på telledato 1. oktober (inkludert bevaringsverdige husdyrraser), dyr på beite, grønt- og potetproduksjon samt disponerte arealer og hvilke vekster som dyrkes på arealene.\u003c/li\u003e\u003c/ul\u003e\u003c/li\u003e\u003c/ul\u003e"
