  },
  "description": {
    "nb": "Dette er datasett som viser leveranser av slakt og ull som er levert fra jordbruksforetak til slakteri. Slakt registrert på person (fødselsnummer) er ikke med i datasettet. For det enkelte foretak vises organisasjonsnummer, navn, kommunenummer og kilo som er levert til slakteri i løpet av kalenderåret. Dataene inkluderer ikke leieslakt. OBS! I datasett for årene 2005-2012 er kolonnene ordnet alfabetisk. I datasett fra 2013 er kolonnene ordnet etter dyreslag."
