  "title": {
    "nb": "Lønnstrinn i staten 2011- Tabell C Hjelpetabell 2011"
  },
  "description": {
    "nb": "Lønnstabeller gjeldende fra og med 1. mai 2011. Datasettet (og historiske versjoner flere år tilbake) er tilgjengeliggjort i pdf, xls og odf-format. Datasettet er også publisert på datahotellet.Det finnes fem lønnstabeller:Tabell A - HovedlønnstabellLønninger for arbeidstakere i staten gjeldende fra 1. mai 2011. Tabellen inneholder lønnstrinn, bruttolønn, nettolønn og pensjonsinnskudd per år, måned og dag, samt overtidsgodtgjørelse og natt-tidskompensasjon.Tabell B - TilleggslønnstabellLønninger for arbeidstakere i staten gjeldende fra 1. mai 2011. Tabellen inneholder lønnstrinn, bruttolønn, nettolønn og pensjonsinnskudd per år, måned og dag, samt overtidsgodtgjørelse og natt-tidskompensasjon.Tabell C - HjelpetabellHjelpetabell for lønnsberegning av timebetalt arbeide gjeldende fra 1. mai 2011. Timesatser basert på forskjellige normaluker. Tabellen inneholder lønnstrinn, bruttolønn og nettolønn for 35,5 og 37,5 timers uker.Tabell T-A - Trekktabell basert på A-tabellenTabell for trekk i lønn ved kortvarige permisjoner basert på A-tabellens brutto og nettolønnssatser, gjeldende fra 1. mai 2011. Tabellen inneholder lønnstrinn, bruttolønn og nettolønn per år og per dag for både 260 dagers år (5 dagers uke) og 312 dagers år (6 dagers uke), samt pensjonsinnskudd per år.Tabell T-B - Trekktabell basert på B-tabellenTabell for trekk i lønn ved kortvarige permisjoner basert på B-tabellens brutto- og nettolønnssatser, gjeldende fra 1. mai 2011. Tabellen inneholder lønnstrinn, bruttolønn og nettolønn per år og per dag for både 260 dagers år (5 dagers uke) og 312 dagers år (6 dagers uke), samt pensjonsinnskudd per år."
