  "title": {
    "nb": "Frie læringsressurser for videregående opplæring"
  },
  "description": {
    "nb": "Nasjonal digital læringsarena (NDLA) er et interfylkeskommunalt samarbeid som tilbyr fritt tilgjengelige åpne digitale læringsressurser for videregående opplæring. Vestland fylkeskommune er juridisk ansvarlige enhet for det interfylkeskommunale samarbeidet, der 10 fylkeskommuner deltar. NDLA sin visjon er å lage gode, åpne digitale læremidler for alle fag i videregående opplæring og støtte opp om elever og lærere i aktivt og deltakende læringsarbeid.LæringsressurseneNDLA ble etablert som prosjekt i 2007 og lanserte de første læringsressursene skoleåret 2008 – 2009. Etter det har porteføljen av fag blitt utvidet år for år. Det langsiktige målet er at NDLA skal kunne tilby komplette læremidler i alle fag i videregående opplæring. Pr 1. januar 2020 tilbyr NDLA læringsresurser i 104 ulike eksamensfag.Nettverk for samarbeid og distribusjonGjennom arbeidet med å utvikle digitale læringsressurser og spre god pedagogisk bruk av dem, har NDLA utviklet et sterkt faglig nettverk for samarbeid og distribusjon mellom fylkeskommunene. Derfor blir NDLA stadig invitert med som samarbeidspart for store og små satsinger innenfor utdanningsområdet nasjonalt og internasjonalt. Et eksempel på dette er Global digital library (https://digitallibrary.io/).Gjenbruk og lisenserAlle elementer er merket med lisensinformasjon. Som hovedregel vil tekst og interaktive oppgaver være merket med lisenser som tillater kommersiell gjenbruk. Interaktive oppgaver med tekst og bilder har lisensinformasjon innebygd (Rights of use)- bilder tillater sjelden kommersiel gjenbruk, noen er merket med copyright- spillefilmer har copyright- filmklipp kan ha ulike lisenserTilgang Alt innhold er tilgjengelig på https://ndla.no, i tillegg kan en bruke https://api.ndla.no for å få tilgang til data og dokumentasjon."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eNasjonal digital læringsarena (NDLA) er et interfylkeskommunalt samarbeid som tilbyr fritt tilgjengelige åpne digitale læringsressurser for videregående opplæring. Vestland fylkeskommune er juridisk ansvarlige enhet for det interfylkeskommunale samarbeidet, der 10 fylkeskommuner deltar. \u003cbr\u003e\u003cbr\u003eNDLA sin visjon er å lage gode, åpne digitale læremidler for alle fag i videregående opplæring og støtte opp om elever og lærere i aktivt og deltakende læringsarbeid.\u003cbr\u003e\u003cbr\u003e\u003cstrong\u003eLæringsressursene\u003c/strong\u003e\u003cbr\u003eNDLA ble etablert som prosjekt i 2007 og lanserte de første læringsressursene skoleåret 2008 – 2009. Etter det har porteføljen av fag blitt utvidet år for år. Det langsiktige målet er at NDLA skal kunne tilby komplette læremidler i alle fag i videregående opplæring. Pr \u003ca rel\u003d\"nofollow\"\u003e1. januar 2020\u003c/a\u003e tilbyr NDLA læringsresurser i 104 ulike eksamensfag.\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eNettverk for samarbeid og distribusjon\u003c/strong\u003e\u003cbr\u003eGjennom arbeidet med å utvikle digitale læringsressurser og spre god pedagogisk bruk av dem, har NDLA utviklet et sterkt faglig nettverk for samarbeid og distribusjon mellom fylkeskommunene. Derfor blir NDLA stadig invitert med som samarbeidspart for store og små satsinger innenfor utdanningsområdet nasjonalt og internasjonalt. Et eksempel på dette er Global digital library (\u003ca href\u003d\"https://eur03.safelinks.protection.outlook.com/?url\u003dhttps%3A%2F%2Fdigitallibrary.io%2F\u0026amp;data\u003d02%7C01%7C%7C63492c7aaa6345ac10a208d7ca5f1ba5%7C008e560f08af4ceca056b35447503991%7C1%7C0%7C637200383478965422\u0026amp;sdata\u003dRavj%2FItDOkeTbNENgstwasPMS3JQycUAswMgDlB9Z4g%3D\u0026amp;reserved\u003d0\" rel\u003d\"nofollow\"\u003ehttps://digitallibrary.io/\u003c/a\u003e).\u003cbr\u003e\u003cbr\u003e\u003cstrong\u003eGjenbruk og lisenser\u003c/strong\u003e\u003cbr\u003eAlle elementer er merket med lisensinformasjon. \u003cbr\u003eSom hovedregel vil tekst og interaktive oppgaver være merket med lisenser som tillater kommersiell gjenbruk. \u003cbr\u003eInteraktive oppgaver med tekst og bilder har lisensinformasjon innebygd (Rights of use)\u003cbr\u003e- bilder tillater sjelden kommersiel gjenbruk, noen er merket med copyright\u003cbr\u003e- spillefilmer har copyright\u003cbr\u003e- filmklipp kan ha ulike lisenser\u003cbr\u003e\u003cbr\u003e\u003cstrong\u003eTilgang \u003c/strong\u003e\u003cbr\u003eAlt innhold er tilgjengelig på \u003ca href\u003d\"https://eur03.safelinks.protection.outlook.com/?url\u003dhttps%3A%2F%2Fndla.no%2F\u0026amp;data\u003d02%7C01%7C%7C63492c7aaa6345ac10a208d7ca5f1ba5%7C008e560f08af4ceca056b35447503991%7C1%7C0%7C637200383478965422\u0026amp;sdata\u003dK%2Frk%2BSmyp0P8OGshFTtuA31SHWyLcHVBNoWIVwgSttc%3D\u0026amp;reserved\u003d0\" rel\u003d\"nofollow\"\u003ehttps://ndla.no\u003c/a\u003e, i tillegg kan en bruke https://api.ndla.no for å få tilgang til data og dokumentasjon.\u003c/p\u003e"
