    "nb": "Los er en felles terminologi for offentlige tjenester med et brukerorientert vokabular. Los består i dag av rundt 400 emneord og har over 1500 hjelpeord (synonym, tidligere emner osv) som kan brukes for gjenkjennelig kategorisering av innhold og ressurser på tvers av portaler og til å hjelpe brukere til å finne fremDet er flere måter å bruke Los-vokabularet på. Den mest nærliggende er å referere til URIer for begrepene når en skal klassifisere en ressurs i et lenkede data-miljø. Standard for beskrivelse av datasett og dataktaloger er et eksempel på bruksområder der Los skal brukes primært som referanse til tema ved hjelp av URIer.Los kan også lastes ned lokalt og brukes som struktur for for eksempel offentlige nettsider. Dersom informasjonen som ligger i RDF/XML-filen blir tatt med i kildekoden for sidene, vil dette bidra til økt søkbarhet ettersom Los tilbyr beskrivelse på flere språk og målformer samt hjelpeord. Merk at oversettelser til andre målformer og språk ikke er komplett. Det vil bli mulig å bidra til flere oversettelser direkte i vokabularets kildekode på Github.Hver term har en stabil og globalt unik http-URI. URIene er bygd opp med følgende struktur: http://psi.norge.no/los/tema/{term}. URIen for termen “arbeid” blir dermed http://psi.norge.no/los/tema/arbeid og denne gir da svar i rdf-format. En html-visning av termen oppnås ved å legge til .html som suffiks. Lenke til html-visning for samme term blir http://psi.norge.no/los/tema/arbeid.html Omskrivningsreglene i selve URIene for særnorske tegn og mellomrom er:æ -\u0026gt; aeø -\u0026gt; oeå -\u0026gt; aa(mellomrom) -\u0026gt; -Eksempel: http://psi.norge.no/los/tema/natur-og-miljoe I Los er både hovedkategorier, underkategorier og emneord et \"SKOS concept\". Disse står i relasjoner til hverandre enten i et hierarki eller en annen form for relasjon."
