  "title": {
    "nb": "Digitalt fortalt"
  },
  "description": {
    "nb": "Digitalt fortalt ble ble etablert i Kulturminneåret 2009 for å stimulere til bruk av digitale fortellinger som formidlingsform og metode i formidlingen av kulturarv. Digitalt fortalt inneholder personlige fortellinger knyttet til kulturarv - gjerne de spennende og annerledes fortellingene - fortellinger som er oppsiktsvekkende, engasjerende, vanskelige, morsomme eller avslørende. 4.658 fortellinger er publisert i Digitalt fortalt.I januar 2016 ble Digitalt fortalt avsluttet, og alt innholdet ble overført til DigitaltMuseum.Digitalt fortalt inneholder følgende dataelementer:- selve fortellingen - tekst, bilder, lyd eller video - eller kombinasjoner av disse medietypene- stedfesting - fylke, kommune, adresse, stedsnavn eller koordinater- kategorier og emneord- ev. brukerkommentarer til fortellingenData fra Digitalt fortalt er tilgjengelige via Norvegianas API. Dette APIet leverer data om enkeltobjekter i xml, json eller kml-format. En stor andel er stedfestet med koordinater (geografiske desimalgrader og UTM 33). APIet er åpent, og det kreves ingen nøkkel.Lisensen (dvs. rettigheter til gjenbruk) ligger på postnivå, og vil således variere fra post til post i datasettet.Norvegiana og de enkelte datasettene er beskrevet i notatet “Norvegiana og KNreise – datamodell, innhold og databaser, API”."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003e\u003ca href\u003d\"https://digitaltmuseum.no/search/?aq\u003dtype:%22story%22\" rel\u003d\"nofollow\"\u003eDigitalt fortalt \u003c/a\u003eble ble etablert i Kulturminneåret 2009 for å stimulere til bruk av digitale fortellinger som formidlingsform og metode i formidlingen av kulturarv. Digitalt fortalt inneholder personlige fortellinger knyttet til kulturarv - gjerne de spennende og annerledes fortellingene - fortellinger som er oppsiktsvekkende, engasjerende, vanskelige, morsomme eller avslørende. 4.658 fortellinger er publisert i Digitalt fortalt.\u003c/p\u003e\u003cp\u003eI januar 2016 ble Digitalt fortalt avsluttet, og alt innholdet ble overført til DigitaltMuseum.\u003c/p\u003e\u003cp\u003eDigitalt fortalt inneholder følgende dataelementer:\u003c/p\u003e\u003cp\u003e- selve fortellingen - tekst, bilder, lyd eller video - eller kombinasjoner av disse medietypene\u003cbr\u003e- stedfesting - fylke, kommune, adresse, stedsnavn eller koordinater\u003cbr\u003e- kategorier og emneord\u003cbr\u003e- ev. brukerkommentarer til fortellingen\u003c/p\u003e\u003cp\u003eData fra Digitalt fortalt er tilgjengelige via Norvegianas API. Dette APIet leverer data om enkeltobjekter i xml, json eller kml-format. En stor andel er stedfestet med koordinater (geografiske desimalgrader og UTM 33). APIet er åpent, og det kreves ingen nøkkel.\u003c/p\u003e\u003cp\u003eLisensen (dvs. rettigheter til gjenbruk) ligger på postnivå, og vil således variere fra post til post i datasettet.\u003c/p\u003e\u003cp\u003eNorvegiana og de enkelte datasettene er beskrevet i notatet “\u003ca href\u003d\"https://norvegianablog.files.wordpress.com/2013/02/norvegiana-datamodell-mapping-innhold-og-databaser.pdf\" rel\u003d\"nofollow\"\u003eNorvegiana og KNreise – datamodell, innhold og databaser, API\u003c/a\u003e”.\u003c/p\u003e"
