  "title": {
    "nb": "Norvegiana API"
  },
  "description": {
    "nb": "Norvegiana er et verktøy for å gjøre kulturarvsinformasjon lettere tilgjengelig som åpne data. Norvegiana er et åpent basseng med kulturdata fra arkiv, museer og andre kulturinstitusjoner; fra i alt ca 300 organisasjoner. Norvegiana inneholder 7,4 mill poster totalt (per august 2016), og av dette er 1,9 mill bilder, 16.000 lydklipp og 1.400 videoer. Norvegiana aggregerer data fra ulike databaser og informasjonskilder, og harmoniserer dette i en felles metadata-modell - ABM Semantic Elements.Data fra Norvegiana er tilgjengelig via et åpent søke-API, og en enkel nettside – www.norvegiana.no.APIet leverer data om enkeltobjekter i xml, json eller kml-format. Ca 3,1 mill objekter er stedfestet med koordinater. APIet er åpent, og det kreves ingen nøkkel.Følgende datakilder er tilgjengelige i Norvegiana (oversikt per august 2016):- DigitaltMuseum - historiske fotografier, gjenstander, kunst (1,8 mill objekter)- Digitalt fortalt - digitale fortellinger (4.700 fortellinger)- Kulturhistorisk leksikon Sogn og Fjordane (1.900 artikler)- MUSIT arkeologi - univeristetsmuseenes arkeologidata (990.000 objekter)- Kystreise - kystens maritime kulturhistorie (2.045 objekter)- Foto SF - Fylkesfoto Sogn og Fjordane (66.000 foto)- Foto MR - Fylkesfotoarkivet Møre og Romsdal (158.000 foto)- Stadnamn SF - stedsnavn Sogn og Fjordane (185.000 stedsnavn)- Stadnamn MR - stedsnavn Møre og Romsdal (samme database som Stadnamn Sogn og Fjordane; 130.000 stedsnavn)- Kildenett - Historisk kilde- og kunnskapsbase for Trøndelag (1.500 artikler)- Musikkarkiv, tradisjons-musikk Sogn og Fjordane (14.000 innførsler)- Arkivportalen - arkivkataloger fra statlige, kommunale og private arkiver (3,4 mill dokumenter)Norvegiana og de enkelte datasettene er beskrevet i notatet “Norvegiana – datamodell, mapping, innhold og databaser”.Lisensen (dvs. rettigheter til gjenbruk) ligger på postnivå, og vil således variere innenfor det enkelte datasettet."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eNorvegiana er et verktøy for å gjøre kulturarvsinformasjon lettere tilgjengelig som åpne data. \u003c/p\u003e\u003cp\u003eNorvegiana er et åpent basseng med kulturdata fra arkiv, museer og andre kulturinstitusjoner; fra i alt ca 300 organisasjoner. Norvegiana inneholder 7,4 mill poster totalt (per august 2016), og av dette er 1,9 mill bilder, 16.000 lydklipp og 1.400 videoer. Norvegiana aggregerer data fra ulike databaser og informasjonskilder, og harmoniserer dette i en felles metadata-modell - \u003ca href\u003d\"https://norvegianablog.wordpress.com/abm-semantic-elements/\" rel\u003d\"nofollow\"\u003eABM Semantic Elements\u003c/a\u003e.\u003c/p\u003e\u003cp\u003eData fra Norvegiana er tilgjengelig via et åpent søke-API, og en enkel nettside – www.norvegiana.no.\u003c/p\u003e\u003cp\u003eAPIet leverer data om enkeltobjekter i xml, json eller kml-format. Ca 3,1 mill objekter er stedfestet med koordinater. APIet er åpent, og det kreves ingen nøkkel.\u003c/p\u003e\u003cp\u003eFølgende datakilder er tilgjengelige i Norvegiana (oversikt per august 2016):\u003c/p\u003e\u003cp\u003e\u003ca href\u003d\"https://digitaltmuseum.no/\" rel\u003d\"nofollow\"\u003e- DigitaltMuseum\u003c/a\u003e - historiske fotografier, gjenstander, kunst (1,8 mill objekter)\u003cbr\u003e\u003ca href\u003d\"https://digitaltmuseum.no/search/?aq\u003dtype:%22story%22\" rel\u003d\"nofollow\"\u003e- Digitalt fortalt\u003c/a\u003e - digitale fortellinger (4.700 fortellinger)\u003cbr\u003e\u003ca href\u003d\"https://leksikon.fylkesarkivet.no/\" rel\u003d\"nofollow\"\u003e- Kulturhistorisk leksikon Sogn og Fjordane\u003c/a\u003e (1.900 artikler)\u003cbr\u003e\u003ca href\u003d\"http://unimus.no/arkeologi/\" rel\u003d\"nofollow\"\u003e- MUSIT arkeologi\u003c/a\u003e - univeristetsmuseenes arkeologidata (990.000 objekter)\u003c/p\u003e\u003cp\u003e- \u003ca href\u003d\"http://kystreise.no/\" rel\u003d\"nofollow\"\u003eKystreise \u003c/a\u003e- kystens maritime kulturhistorie (2.045 objekter)\u003cbr\u003e\u003ca href\u003d\"https://www.fylkesarkivet.no/foto.380536.no.html\" rel\u003d\"nofollow\"\u003e- Foto SF\u003c/a\u003e - Fylkesfoto Sogn og Fjordane (66.000 foto)\u003cbr\u003e\u003ca href\u003d\"https://www.fylkesarkivet.no/foto.380536.no.html\" rel\u003d\"nofollow\"\u003e- Foto MR\u003c/a\u003e - Fylkesfotoarkivet Møre og Romsdal (158.000 foto)\u003cbr\u003e\u003ca href\u003d\"https://www.fylkesarkivet.no/stadnamn.380535.no.html\" rel\u003d\"nofollow\"\u003e- Stadnamn SF\u003c/a\u003e - stedsnavn Sogn og Fjordane (185.000 stedsnavn)\u003cbr\u003e\u003ca href\u003d\"https://www.fylkesatlas.no/stadnamn_more_og_romsdal\" rel\u003d\"nofollow\"\u003e- Stadnamn MR\u003c/a\u003e - stedsnavn Møre og Romsdal (samme database som Stadnamn Sogn og Fjordane; 130.000 stedsnavn)\u003cbr\u003e\u003ca href\u003d\"http://www.kildenett.no/\" rel\u003d\"nofollow\"\u003e- Kildenett\u003c/a\u003e - Historisk kilde- og kunnskapsbase for Trøndelag (1.500 artikler)\u003cbr\u003e\u003ca href\u003d\"https://www.fylkesarkivet.no/musikk.380537.no.html\" rel\u003d\"nofollow\"\u003e- Musikkarkiv\u003c/a\u003e, tradisjons-musikk Sogn og Fjordane (14.000 innførsler)\u003cbr\u003e\u003ca href\u003d\"http://www.arkivportalen.no\" rel\u003d\"nofollow\"\u003e- Arkivportalen\u003c/a\u003e - arkivkataloger fra statlige, kommunale og private arkiver (3,4 mill dokumenter)\u003c/p\u003e\u003cp\u003eNorvegiana og de enkelte datasettene er beskrevet i notatet “\u003ca href\u003d\"https://norvegianablog.files.wordpress.com/2013/02/norvegiana-datamodell-mapping-innhold-og-databaser.pdf\" rel\u003d\"nofollow\"\u003eNorvegiana – datamodell, mapping, innhold og databaser\u003c/a\u003e”.\u003c/p\u003e\u003cp\u003eLisensen (dvs. rettigheter til gjenbruk) ligger på postnivå, og vil således variere innenfor det enkelte datasettet.\u003c/p\u003e"
