  "title": {
    "nb": "Artskart"
  },
  "description": {
    "nb": "Artsdatabanken og GBIF-Norge har sammen med dataeierne laget denne tjenesten for å formidle stedfestet artsinformasjon fra Norge og Svalbard. Her kan du søke på arter og finne hvor arten er funnet. Du kan også søke på geografiske områder, fylke eller kommune, og få vist i kartet hvilke arter som er funnet.Tjenesten er ufullstendig i den forstand at ikke alle eksisterende funn av artene er tilgjengelig i tjenesten. Mange artsfunn er ikke digitalisert ennå og mange primærdatabaser er ennå ikke gjort tilgjengelig for tjenesten. Artsdatabanken og GBIF-Norge arbeider systematisk med å gjøre stadig flere datasett tilgjengelig etterhvert som de kvalitetssikres hos dataeier. Artskart bygger på prinsippene i Norge Digitalt. Hver dataeier publiserer sine data fra primærdatabasene gjennom standardiserte formater. Artskart leser dataene fra hver enkelt datakilde og gjør dem tilgjengelig på kart fra alle datakildene samtidig."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eArtsdatabanken og GBIF-Norge har sammen med dataeierne laget denne tjenesten for å formidle stedfestet artsinformasjon fra Norge og Svalbard. Her kan du søke på arter og finne hvor arten er funnet. Du kan også søke på geografiske områder, fylke eller kommune, og få vist i kartet hvilke arter som er funnet.\u003c/p\u003e\u003cp\u003eTjenesten er ufullstendig i den forstand at ikke alle eksisterende funn av artene er tilgjengelig i tjenesten. Mange artsfunn er ikke digitalisert ennå og mange primærdatabaser er ennå ikke gjort tilgjengelig for tjenesten. Artsdatabanken og GBIF-Norge arbeider systematisk med å gjøre stadig flere datasett tilgjengelig etterhvert som de kvalitetssikres hos dataeier. Artskart bygger på prinsippene i Norge Digitalt. Hver dataeier publiserer sine data fra primærdatabasene gjennom standardiserte formater. Artskart leser dataene fra hver enkelt datakilde og gjør dem tilgjengelig på kart fra alle datakildene samtidig.\u003c/p\u003e"
