  "description": {
    "nb": "Oslo kommune har samlet en rekke statistikkområder i en felles statistikkbank. Tabellene i Statistikkbanken gir mulighet til å generere grafer og excelfiler.Områdene med underliggende temaer er (pr. 27.01.2017):Befolkning (Folkemengde, Fødte, Døde, Flytting, Landbakgrunn, Husholdninger, Befolkningsframskrivninger)Inntekt, levekår og sosiale forhold (Inntekt, Trygd, Sosialtjenester, Barnevern, Utdanningsnivå, Trangboddhet, Kriminalitet og rettsforhold, Andre levekårsmål)Barnehage, skole og høyere utdanning (Barnehager, Grunnskolen, Videregående skole, Voksenopplæring, Høyere utdanning)Oslohelsa (Helsetilstand, Helserelatert adferd, ommunehelsetjenesten, Pleie og omsorgstjenester)Samfunnsliv (Valgresultater, Sosial kontakt, Trivsel i Oslo, Tro, livssyn og seremonier, Kultur og idrett)Boliger, bygg, arbeids- og næringsliv (Næringsliv, Sysselsetting og arbeidsledige, Pendling, Boligmengden, Byggevirksomhet)Miljø og samferdsel (Klima og energi, Luftkvalitet, Trafikkstøy og stille områder, Reisemiddelfordeling, Bil- og kollektivtrafikk, Luft- og skipstrafikk, Natur og biologisk mangfold, Areal og friområder, Vann og vassdrag, Avfall og gjenvinning, Forurenset grunn, Radon)Kommunal økonomi og forvaltning (Økonomi og regnskap, Kommunalt ansatte)"
  },
